import React from "react"
import "../index.css"

function Popup(props) {
  return (props.trigger) ? (
    <div className='popup'>
        <div className='popup-inner relative bg-grey-600 rounded-lg shadow-lg w-auto min-w-[300px] max-w-md p-5'>
            <button onClick={() => props.setTrigger(false)} className="close-btn absolute top-3 right-3 text-black bg-transparent hover:bg-gray-200 p-2 rounded-md">  
            Close 
            </button>
            {props.children}
        </div>
    </div>
  ) : "";
} 

export default Popup
